import React from "react"
import TodoItem from "./components/TodoItem"
import todosData from "./todosData"

function App() {
	const TodoItemComponents = todosData.map(item => <TodoItem key={item.id} todo={item}/>)
	return(
		<div className="todo-list">
			{TodoItemComponents}
		</div>

	)
}

export default App
